import {STEPS} from "./Steps";

 const FLOWS_LIST = {

    noTransaction: {
        normal: [
            STEPS.SELECT_REASON,
            STEPS.PURCHASE_DETAILS,
            STEPS.TRANSACTION_DETAILS,
            STEPS.ATTACHMENT,
            STEPS.THANK_YOU
        ],
        noTransactionPurchaseIncorrect: [
            STEPS.PURCHASE_INCORRECT
        ]
    },
    differentAmount: {
        normal: [
            STEPS.SELECT_REASON,
            STEPS.TRANSACTION_DETAILS,
            STEPS.ATTACHMENT,
            STEPS.DESCRIPTION,
            STEPS.THANK_YOU
        ]
    },
    status: {
        normal: [
            STEPS.SELECT_REASON,
            STEPS.TRANSACTION_DETAILS,
            STEPS.ATTACHMENT,
            STEPS.DESCRIPTION,
            STEPS.THANK_YOU
        ]
    },
    cashbackRejected: {
        normal: [
            STEPS.SELECT_REASON,
            STEPS.PURCHASE_RETURNED_OR_COMPANY,
            STEPS.TRANSACTION_DETAILS,
            STEPS.ATTACHMENT,
            STEPS.THANK_YOU
        ],
        error: [
            STEPS.ERROR_PURCHASE_RETURNED_OR_COMPANY
        ]
    },
    payout: {
        normal: [
            STEPS.SELECT_REASON,
            STEPS.SELECT_TRANSACTION,
            STEPS.SHOW_INFO_ABOUT_TRANSACTION,
            STEPS.THANK_YOU
        ],
        askAboutTransaction: [
            STEPS.SELECT_REASON,
            STEPS.SELECT_TRANSACTION,
            STEPS.SHOW_INFO_ABOUT_TRANSACTION,
            STEPS.DESCRIPTION,
            STEPS.THANK_YOU
        ],
        noTransactions: [
            STEPS.SELECT_REASON,
            STEPS.SELECT_TRANSACTION,
            STEPS.DESCRIPTION,
            STEPS.THANK_YOU
        ],
        differentStatus: [
            STEPS.SELECT_REASON,
            STEPS.SELECT_TRANSACTION,
            STEPS.DESCRIPTION,
            STEPS.THANK_YOU
        ]
    },
    other: {
        normal: [
            STEPS.SELECT_REASON,
            STEPS.DESCRIPTION,
            STEPS.ATTACHMENT,
            STEPS.THANK_YOU
        ]
    }
}

export default FLOWS_LIST
